class Solution {
    public List<Integer> rolling_max(List<Integer> numbers) {
        List<Integer> rolling_max_list = new ArrayList<>();
        int max_so_far = Integer.MIN_VALUE;
        for (int num : numbers) {
            if (num > max_so_far) {
                max_so_far = num;
            }
            rolling_max_list.add(max_so_far);
        }
        return rolling_max_list;
    }
}

