class Solution {
    public boolean has_close_elements(List<Double> numbers, double threshold) {
        Collections.sort(numbers);
        for (int i = 1; i < numbers.size(); i++) {
            double distance = Math.abs(numbers.get(i) - numbers.get(i - 1));
            if (distance < threshold) {
                return true;
            }
        }
        return false;
    }
}

