class Solution {
    public List<Integer> parse_music(String string) {
        List<Integer> result = new ArrayList<>();
        int i = 0;
        while (i < string.length()) {
            if (string.charAt(i) == 'o' && (i == string.length() - 1 || string.charAt(i + 1) != '|')) {
                result.add(4);
                i++;
            } else if (string.charAt(i) == 'o' && string.charAt(i + 1) == '|') {
                result.add(2);
                i += 2;
            } else if (string.charAt(i) == '.' && string.charAt(i + 1) == '|') {
                result.add(1);
                i += 2;
            } else {
                i++;
            }
        }
        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.parse_music("").equals(List.of()),
