class Solution {
    public int largest_divisor(int n) {
        int potential_divisor = n - 1;
        while (potential_divisor > 0) {
            if (n % potential_divisor == 0) {
                return potential_divisor;
            }
            potential_divisor--;
        }
        return 1;
    }
}

