class Solution {
    public List<Integer> factorize(int n) {
        List<Integer> primeFactors = new ArrayList<>();
        int divisor = 2;
        while (n > 1) {
            if (n % divisor == 0) {
                primeFactors.add(divisor);
                n = n / divisor;
            } else {
                divisor++;
            }
        }
        return primeFactors;
    }
}

