class Solution {
    public String sort_numbers(String numbers) {
        // Create a HashMap to map number words to integer values
        Map<String, Integer> numMap = new HashMap<>();
        numMap.put("zero", 0);
        numMap.put("one", 1);
        numMap.put("two", 2);
        numMap.put("three", 3);
