class Solution {
    public List<Double> find_closest_elements(List<Double> numbers) {
        List<Double> closest_pair = new ArrayList<>();
        closest_pair.add(numbers.get(0));
        closest_pair.add(numbers.get(1));
        double min_diff = Math.abs(numbers.get(1) - numbers.get(0));
        for (int i = 0; i < numbers.size() - 1; i++) {
            double diff = Math.abs(numbers.get(i + 1) - numbers.get(i));
            if (diff < min_diff) {
                min_diff = diff;
                closest_pair.clear();
                closest_pair.add(numbers.get(i));
                closest_pair.add(numbers.get(i + 1));
            }
        }
        Collections.sort(closest_pair);
        return closest_pair;
    }
}

