class Solution {
    public List<Double> rescale_to_unit(List<Double> numbers) {
        double min_value = Collections.min(numbers);
        double max_value = Collections.max(numbers);
        double range = max_value - min_value;

        List<Double> result = new ArrayList<>();
        for (double number : numbers) {
            double normalized_number = (number - min_value) / range;
            result.add(normalized_number);
        }

        return result;
    }
}

