        for (int i = 0; i < l.size(); i++) {
            if (i % 2 == 0) {
                even_list.add(l.get(i));
            } else {
                odd_list.add(l.get(i));
            }
        }

        Collections.sort(even_list);

        List<Integer> result_list = new ArrayList<>();

        for (int i = 0; i < l.size(); i++) {
            if (i % 2 == 0) {
                result_list.add(even_list.get(i / 2));
            } else {
                result_list.add(odd_list.get(i / 2));
            }
        }

        return result_list;
    }
}

