class Solution {
    public List<Integer> sort_third(List<Integer> l) {
        // Separate values at indices that are divisible by three
        List<Integer> third_values = new ArrayList<>();
        for (int i = 0; i < l.size(); i++) {
            if (i % 3 == 0) {
                third_values.add(l.get(i));
            }
        }

        // Sort the separated values
        Collections.sort(third_values);

        // Create a new list l' and copy values from l
        List<Integer> l_prime = new ArrayList<>();
        int third_index = 0;
        for (int i = 0; i < l.size(); i++) {
            if (i % 3 == 0) {
                l_prime.add(third_values.get(third_index));
                third_index++;
            } else {
                l_prime.add(l.get(i));
            }
        }

        return l_prime;
    }
}

