class Solution {
    public int prime_fib(int n) {
        int count = 0;
        int a = 0, b = 1;
        while (count < n) {
            if (is_prime(b)) {
                count++;
                if (count == n) {
                    return b;
                }
            }
            int temp = a;
            a = b;
            b = temp + b;
        }
        return -1; // Return -1 if no such number is found
    }

    public boolean is_prime(int num) {
        if (num < 2) {
            return false;
        }
        for (int i = 2; i <= Math.sqrt(num); i++) {
            if (num % i == 0) {
                return false;
            }
        }
        return true;
    }
}

