class Solution {
    public int modp(int n, int p) {
        int result = 1;
        int base = 2;
        while (n > 0) {
            if (n % 2 == 1) {
                result = (result * base) % p;
            }
            base = (base * base) % p;
            n = n / 2;
        }
        return result;
    }
}

