class Solution {
    public String circular_shift(int x, int shift) {
        String str = Integer.toString(x);
        int n = str.length();
        int effectiveShift = shift % n;
        if (effectiveShift == 0) {
            return str;
        } else if (effectiveShift == n) {
            StringBuilder sb = new StringBuilder(str);
            return sb.reverse().toString();
        } else {
            return str.substring(n - effectiveShift) + str.substring(0, n - effectiveShift);
        }
    }
}

