class Solution {
    public List<Integer> strange_sort_list(List<Integer> lst) {
        List<Integer> copy = new ArrayList<>(lst);
        List<Integer> sortedList = new ArrayList<>();
        boolean isMin = true;
        while (!copy.isEmpty()) {
            int value;
            if (isMin) {
                value = Collections.min(copy);
            } else {
                value = Collections.max(copy);
            }
            sortedList.add(value);
            copy.remove((Integer) value);
            isMin = !isMin;
        }
        return sortedList;
    }
}

