class Solution {
    public boolean will_it_fly(List<Integer> q, int w) {
        // Check if the list is palindromic
        boolean isBalanced = isPalindromic(q);

        // Calculate the sum of the elements in the list
        int sum = calculateSum(q);

        // Check if the sum is less than or equal to the maximum possible weight
        boolean isWithinWeightLimit = sum <= w;

        // Return true if the object is balanced and within the weight limit, false otherwise
        return isBalanced && isWithinWeightLimit;
    }

    // Helper function to check if a list is palindromic
    public boolean isPalindromic(List<Integer> list) {
        int left = 0;
        int right = list.size() - 1;
        while (left < right) {
            if (!list.get(left).equals(list.get(right))) {
                return false;
            }
            left++;
            right--;
        }
        return true;
    }

    // Helper function to calculate the sum of elements in a list
    public int calculateSum(List<Integer> list) {
        int sum = 0;
        for (Integer num : list) {
            sum += num;
        }
        return sum;
    }
}

