class Solution {
    public boolean is_multiply_prime(int a) {
        List<Integer> prime_numbers = new ArrayList<>();
        for (int i = 2; i < 100; i++) {
            if (isPrime(i)) {
                prime_numbers.add(i);
            }
        }

        for (int i : prime_numbers) {
            for (int j : prime_numbers) {
                for (int k : prime_numbers) {
                    if (i * j * k == a) {
                        return true;
                    }
                }
            }
        }
        return false;
    }

    public boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        for (int i = 2; i <= Math.sqrt(n); i++) {
            if (n % i == 0) {
                return false;
            }
        }
        return true;
    }
}

