class Solution {
    public int starts_one_ends(int n) {
        // Calculate total number of n-digit numbers
        int total_numbers = 9 * (int)Math.pow(10, n-1);

        // Calculate numbers that do not start with 1
        int no_start_one = 8 * (int)Math.pow(10, n-1);

        // Calculate numbers that do not end with 1
        int no_end_one = 9 * (int)Math.pow(10, n-1) - 1;

        // Calculate numbers that do not start or end with 1
        int no_start_or_end_one = no_start_one - (no_end_one - total_numbers);

        // Return the count of numbers that start or end with 1
        return total_numbers - no_start_or_end_one;
    }
}

