class Solution {
    public String encode(String message) {
        StringBuilder encodedMessage = new StringBuilder();
        for (char c : message.toCharArray()) {
            if (isVowel(c)) {
                encodedMessage.append(getNextVowel(c));
            } else {
                encodedMessage.append(c);
            }
            if (Character.isUpperCase(c)) {
                encodedMessage.setCharAt(encodedMessage.length() - 1, Character.toLowerCase(encodedMessage.charAt(encodedMessage.length() - 1)));
            } else {
                encodedMessage.setCharAt(encodedMessage.length() - 1, Character.toUpperCase(encodedMessage.charAt(encodedMessage.length() - 1)));
            }
        }
        return encodedMessage.toString();
    }

    private boolean isVowel(char c) {
        String vowels = "aeiouAEIOU";
        return vowels.indexOf(c) != -1;
    }

    private char getNextVowel(char c) {
        String vowels = "aeiouAEIOU";
        int index = vowels.indexOf(c);
        if (index == -1) {
            return c;
        }
        index = (index + 2) % vowels.length();
        return vowels.charAt(index);
    }
}

