class Solution {
    public List<Integer> sort_array(List<Integer> array) {
        // Create a copy of the given array to avoid modifying it
        List<Integer> copiedArray = new ArrayList<>(array);

        // Check if the array is empty
        if (copiedArray.isEmpty()) {
            return copiedArray;
        }

        // Calculate the sum of the first and last index values
        int sum = copiedArray.get(0) + copiedArray.get(copiedArray.size() - 1);

        // Sort the array in ascending order if the sum is odd
        if (sum % 2 != 0) {
            Collections.sort(copiedArray);
        } 
        // Sort the array in descending order if the sum is even
        else {
            Collections.sort(copiedArray, Collections.reverseOrder());
        }

        return copiedArray;
    }
}

