class Solution {
    public int closest_integer(String value) {
        double num = Double.parseDouble(value);
        double decimalPart = num - Math.floor(num);
        if (decimalPart < 0.5) {
            return (int) Math.floor(num);
        } else if (decimalPart > 0.5) {
            return (int) Math.ceil(num);
        } else {
            if (num > 0) {
                return (int) Math.ceil(num);
            } else {
                return (int) Math.floor(num);
            }
        }
    }
}

