class Solution {
    public List<Integer> make_a_pile(int n) {
        List<Integer> levels = new ArrayList<>();
        int current_level = n;
        while (levels.size() < n) {
            levels.add(current_level);
            if (current_level % 2 == 0) {
                current_level += 1;
            } else {
                current_level += 2;
            }
        }
        return levels;
    }
}

