class Solution {
    public List<String> by_length(List<Integer> arr) {
        // Filter the array to include only numbers between 1 and 9
        List<Integer> filteredArr = new ArrayList<>();
        for (Integer num : arr) {
            if (num >= 1 && num <= 9) {
                filteredArr.add(num);
            }
        }

        // Sort the filtered array
        Collections.sort(filteredArr);

        // Reverse the sorted array
        Collections.reverse(filteredArr);

        // Create a map to map numbers to their corresponding names
        Map<Integer, String> numToName = new HashMap<>();
        numToName.put(1, "One");
        numToName.put(2, "Two");
        numToName.put(3, "Three");
        numToName.put(4, "Four");
        numToName.put(5, "Five");
        numToName.put(6, "Six");
        numToName.put(7, "Seven");
        numToName.put(8, "Eight");
        numToName.put(9, "Nine");

        // Replace each number with its corresponding name
        List<String> result = new ArrayList<>();
        for (Integer num : filteredArr) {
            result.add(numToName.get(num));
        }

        return result;
    }
}

