class Solution {
    public int count_nums(List<Integer> arr) {
        int count = 0;
        for (Integer num : arr) {
            int sum = 0;
            String str = String.valueOf(Math.abs(num));
            for (char c : str.toCharArray()) {
                sum += Character.getNumericValue(c);
            }
            if (sum > 0) {
                count++;
            }
        }
        return count;
    }
}

