class Solution {
    public String exchange(List<Integer> lst1, List<Integer> lst2) {
        int count_odd_in_lst1 = 0;
        int count_even_in_lst2 = 0;

        for (int element : lst1) {
            if (element % 2 != 0) {
                count_odd_in_lst1 += 1;
            }
        }

        for (int element : lst2) {
            if (element % 2 == 0) {
                count_even_in_lst2 += 1;
            }
        }

        if (count_odd_in_lst1 <= count_even_in_lst2) {
            return "YES";
        } else {
            return "NO";
        }
    }
}

