class Solution {
    public int minSubArraySum(List<Integer> nums) {
        int min_sum = Integer.MAX_VALUE;
        int current_sum = 0;
        for (int num : nums) {
            current_sum += num;
            if (current_sum < min_sum) {
                min_sum = current_sum;
            }
            if (current_sum > 0) {
                current_sum = 0;
            }
        }
        return min_sum;
    }
}

