class Solution {
    public List<Object> reverse_delete(String s, String c) {
        // Create a StringBuilder to efficiently build the result string
        StringBuilder result = new StringBuilder();

        // Iterate over each character in the string s
        for (char ch : s.toCharArray()) {
            // Check if the character is not in the string c
            if (c.indexOf(ch) == -1) {
                // If the character is not in c, append it to the result string
                result.append(ch);
            }
        }

        // Convert the result StringBuilder to a string
        String resultStr = result.toString();

        // Check if the result string is a palindrome
        boolean isPalindrome = resultStr.equals(resultStr.reverse().toString());

        // Create a list to store the result string and the palindrome check
        List<Object> list = new ArrayList<>();
        list.add(resultStr);
        list.add(isPalindrome);

        // Return the list
        return list;
    }
}

