class Solution {
    public int max_fill(List<List<Integer>> grid, int capacity) {
        int total_times = 0;
        for (List<Integer> well : grid) {
            int water_units = 0;
            for (int unit : well) {
                water_units += unit;
            }
            total_times += (water_units + capacity - 1) / capacity;
        }
        return total_times;
    }
}

