class Solution {
    public String match_parens(List<String> lst) {
        int open_count1 = 0, close_count1 = 0, open_count2 = 0, close_count2 = 0;
        for (char c : lst.get(0).toCharArray()) {
            if (c == '(') {
                open_count1++;
            } else {
                close_count1++;
            }
        }
        for (char c : lst.get(1).toCharArray()) {
            if (c == '(') {
                open_count2++;
            } else {
                close_count2++;
            }
        }
        if (open_count1 + open_count2 == close_count1 + close_count2) {
            return "Yes";
        } else {
            return "No";
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.match_parens(Arrays.asList("()(", ")")).equals("Yes"),
                s.match_parens(Arrays.asList(")", ")")).equals("No"),
                s.match_parens(Arrays.asList("(()(())", "())())")).equals("No"),
                s.match_parens(Arrays.asList(")())", "(()()(")).equals("Yes"),
                s.match_parens(Arrays.asList("(())))", "(()())((")).equals("Yes"),
                s.match_parens(Arrays.asList("()", "())")).equals("No"),
                s.match_parens(Arrays.asList("(()(", "()))()")).equals("Yes"),
                s.match_parens(Arrays.asList("((((", "((())")).equals("No"),
                s.match_parens(Arrays.asList(")(()", "(()(")).equals("No"),
                s.match_parens(Arrays.asList(")(", ")(")).equals("No")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

