class Solution {
    public List<Integer> get_odd_collatz(int n) {
        List<Integer> odd_numbers = new ArrayList<>();
        int current = n;
        while (current != 1) {
            if (current % 2 != 0) {
                odd_numbers.add(current);
            }
            if (current % 2 == 0) {
                current = current / 2;
            } else {
                current = current * 3 + 1;
            }
        }
        odd_numbers.add(1);
        Collections.sort(odd_numbers);
        return odd_numbers;
    }
}

