class Solution {
    public Object split_words(String txt) {
        // First, try to split the string on whitespace
        String[] words = txt.split("\\s+");

        // If the resulting array has more than one element, return it
        if (words.length > 1) {
            return Arrays.asList(words);
        }

        // If not, try to split the string on commas
        words = txt.split(",");

        // If the resulting array has more than one element, return it
        if (words.length > 1) {
            return Arrays.asList(words);
        }

        // If not, count the number of lower-case letters with odd order in the alphabet
        int count = 0;
        for (char c : txt.toCharArray()) {
            if (Character.isLowerCase(c) && (c - 'a') % 2 != 0) {
                count++;
            }
        }

        // Return the count
        return count;
    }
}

