class Solution {
    public List<Integer> tri(int n) {
        List<Integer> tribonacci = new ArrayList<>();
        tribonacci.add(1);
        if (n == 0) return tribonacci;
        tribonacci.add(3);
        if (n == 1) return tribonacci;
        tribonacci.add(2);
        if (n == 2) return tribonacci;
        for (int i = 3; i <= n; i++) {
            if (i % 2 == 0) {
                tribonacci.add(1 + i / 2);
            } else {
                tribonacci.add(tribonacci.get(i - 2) + tribonacci.get(i - 3) + tribonacci.get(i - 1));
            }
        }
        return tribonacci;
    }
}

