class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int n = grid.size();
        int[][] directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> {
            for (int i = 0; i < k; i++) {
                if (a[i] != b[i]) return a[i] - b[i];
            }
            return 0;
        });
        boolean[][][] visited = new boolean[n][n][k + 1];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                int[] path = new int[k];
                Arrays.fill(path, grid.get(i).get(j));
                pq.offer(new int[]{i, j, 1, grid.get(i).get(j)});
                visited[i][j][1] = true;
            }
        }
        while (!pq.isEmpty()) {
            int[] current = pq.poll();
            int x = current[0], y = current[1], len = current[2];
            if (len == k) {
                List<Integer> result = new ArrayList<>();
                for (int i = 3; i < current.length; i++) {
                    result.add(current[i]);
                }
                return result;
            }
            for (int[] direction : directions) {
                int nx = x + direction[0], ny = y + direction[1];
                if (nx >= 0 && nx < n && ny >= 0 && ny < n && !visited[nx][ny][len + 1]) {
                    int[] newPath = Arrays.copyOf(current, current.length + 1);
                    newPath[newPath.length - 1] = grid.get(nx).get(ny);
                    pq.offer(newPath);
                    visited[nx][ny][len + 1] = true;
                }
            }
        }
        return new ArrayList<>();
    }
}

