class Solution {
    public Optional<Object> compare_one(Object a, Object b) {
        // Convert string representations of numbers to doubles
        double aValue = convertToDouble(a);
        double bValue = convertToDouble(b);

        // If the values are equal, return an empty Optional
        if (aValue == bValue) {
            return Optional.empty();
        }

        // Return the larger value in its original type
        if (aValue > bValue) {
            return Optional.of(a);
        } else {
            return Optional.of(b);
        }
    }

    private double convertToDouble(Object value) {
        if (value instanceof String) {
            // Replace comma with dot if necessary
            String strValue = ((String) value).replace(',', '.');
            return Double.parseDouble(strValue);
        } else if (value instanceof Integer || value instanceof Double) {
            return ((Number) value).doubleValue();
        } else {
            throw new UnsupportedOperationException("Unsupported data type");
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                (int) s.compare_one(1, 2).get() == 2,
