class Solution {
    public boolean is_equal_to_sum_even(int n) {
        for (int i = 2; i <= n / 4; i += 2) {
            if (can_be_expressed_as_sum_of_three_even_numbers(n - i)) {
                return true;
            }
        }
        return false;
    }

    public boolean can_be_expressed_as_sum_of_three_even_numbers(int x) {
        for (int j = 2; j <= x / 3; j += 2) {
            for (int k = j; k <= (x - j) / 2; k += 2) {
                if ((x - j - k) % 2 == 0) {
                    return true;
                }
            }
        }
        return false;
    }
}

