class Solution {
    public String file_name_check(String file_name) {
        // Check if the file name contains exactly one dot
        if (file_name.indexOf('.') != file_name.lastIndexOf('.')) {
            return "No";
        }

        // Split the file name into two parts: before and after the dot
        String[] parts = file_name.split("\\.");

        // Check if the substring before the dot is not empty and starts with a latin alphabet letter
        if (parts[0].isEmpty() || !Character.isLetter(parts[0].charAt(0))) {
            return "No";
        }

        // Check if the substring after the dot is one of the allowed extensions
        if (!Arrays.asList("txt", "exe", "dll").contains(parts[1])) {
            return "No";
        }

        // Count the number of digits in the file name
        int digitCount = 0;
        for (char c : file_name.toCharArray()) {
            if (Character.isDigit(c)) {
                digitCount++;
            }
        }

        // Check if there are more than three digits in the file name
        if (digitCount > 3) {
            return "No";
        }

        // If all conditions are met, return "Yes"
        return "Yes";
    }
}

