class Solution {
    public String fix_spaces(String text) {
        StringBuilder result = new StringBuilder();
        int spaceCount = 0;
        for (char c : text.toCharArray()) {
            if (c == ' ') {
                spaceCount++;
            } else {
                if (spaceCount > 2) {
                    result.append('-');
                } else if (spaceCount > 0) {
                    for (int i = 0; i < spaceCount; i++) {
                        result.append('_');
                    }
                }
                result.append(c);
                spaceCount = 0;
            }
        }
        return result.toString();
    }
}

