class Solution {
    public boolean simplify(String x, String n) {
        // Split the input strings into numerators and denominators
        String[] x_parts = x.split("/");
        String[] n_parts = n.split("/");

        int x_num = Integer.parseInt(x_parts[0]);
        int x_den = Integer.parseInt(x_parts[1]);
        int n_num = Integer.parseInt(n_parts[0]);
        int n_den = Integer.parseInt(n_parts[1]);

        // Multiply the numerators and denominators
        long result_num = (long) x_num * n_num;
        long result_den = (long) x_den * n_den;

        // Check if the resulting fraction can be simplified to a whole number
        if (result_den == 1 || result_num % result_den == 0) {
            return true;
        } else {
            return false;
        }
    }
}

