class Solution {
    public int get_max_triples(int n) {
        int count = 0;
        int[] a = new int[n];
        int[] remainder_count = new int[3];
        for (int i = 1; i <= n; i++) {
            a[i-1] = i * i - i + 1;
            int remainder = a[i-1] % 3;
            remainder_count[remainder]++;
        }
        count += remainder_count[0] * (remainder_count[0] - 1) * (remainder_count[0] - 2) / 6;
        count += remainder_count[1] * remainder_count[1] * (remainder_count[1] - 1) / 6;
        count += remainder_count[2] * remainder_count[2] * (remainder_count[2] - 1) / 6;
        count += remainder_count[0] * remainder_count[1] * remainder_count[2];
        return count;
    }
}

