class Solution {
    public List<Integer> order_by_points(List<Integer> nums) {
        List<Pair> pairs = new ArrayList<>();
        for (int i = 0; i < nums.size(); i++) {
            int sum = sumOfDigits(nums.get(i));
            pairs.add(new Pair(nums.get(i), sum, i));
        }
        Collections.sort(pairs, (a, b) -> {
            if (a.sum == b.sum) {
                return a.index - b.index;
            } else {
                return a.sum - b.sum;
            }
        });
        List<Integer> result = new ArrayList<>();
        for (Pair pair : pairs) {
            result.add(pair.num);
        }
        return result;
    }

    private int sumOfDigits(int num) {
        int sum = 0;
        while (num != 0) {
            sum += Math.abs(num % 10);
            num /= 10;
        }
        return sum;
    }

    private class Pair {
        int num;
        int sum;
        int index;

        public Pair(int num, int sum, int index) {
            this.num = num;
            this.sum = sum;
            this.index = index;
        }
    }
}

