class Solution {
    public List<String> bf(String planet1, String planet2) {
        String[] planets = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};
        List<String> result = new ArrayList<>();

        // Check if both planets are valid
        if (!isValidPlanet(planet1, planets) || !isValidPlanet(planet2, planets)) {
            return result;
        }

        // Find the indices of the two planets
        int index1 = findIndex(planet1, planets);
        int index2 = findIndex(planet2, planets);

        // Swap indices if necessary
        if (index1 > index2) {
            int temp = index1;
            index1 = index2;
            index2 = temp;
        }

        // Add planets between the two indices to the result
        for (int i = index1 + 1; i < index2; i++) {
            result.add(planets[i]);
        }

        return result;
    }

    // Helper function to check if a planet is valid
    private boolean isValidPlanet(String planet, String[] planets) {
        for (String p : planets) {
            if (p.equals(planet)) {
                return true;
            }
        }
        return false;
    }

    // Helper function to find the index of a planet
    private int findIndex(String planet, String[] planets) {
        for (int i = 0; i < planets.length; i++) {
            if (planets[i].equals(planet)) {
                return i;
            }
        }
        return -1;
    }
}

public class Main {
