class Solution {
    public String Strongest_Extension(String class_name, List<String> extensions) {
        String strongest_extension = extensions.get(0);
        int max_strength = calculateStrength(strongest_extension);

        for (int i = 1; i < extensions.size(); i++) {
            int strength = calculateStrength(extensions.get(i));
            if (strength > max_strength) {
                max_strength = strength;
                strongest_extension = extensions.get(i);
            }
        }

        return class_name + "." + strongest_extension;
    }

    private int calculateStrength(String extension) {
        int cap = 0;
        int sm = 0;

        for (char c : extension.toCharArray()) {
            if (Character.isUpperCase(c)) {
                cap++;
            } else if (Character.isLowerCase(c)) {
                sm++;
            }
        }

        return cap - sm;
    }
}

