class Solution {
    public String find_max(List<String> words) {
        int max_unique_chars = 0;
        String result = "";

        for (String word : words) {
            Set<Character> unique_chars = new HashSet<>();
            for (char c : word.toCharArray()) {
                unique_chars.add(c);
            }

            if (unique_chars.size() > max_unique_chars) {
                max_unique_chars = unique_chars.size();
                result = word;
            } else if (unique_chars.size() == max_unique_chars) {
                if (word.compareTo(result) < 0) {
                    result = word;
                }
            }
        }

        return result;
    }
}

