class Solution {
    public boolean is_simple_power(int x, int n) {
        int power = 0;
        int result = 1;
        while (result <= x) {
            if (result == x) {
                return true;
            }
            power = power + 1;
            result = (int) Math.pow(n, power);
        }
        return false;
    }
}

